import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Button } from 'reactstrap';
import Widget from './Widgets/widget';
import Widget1 from './Widgets1/widget1';
import Widget2 from './Widgets2/widget2';
import Widget3 from './Widgets3/widget3';
import Widget4 from './Widgets4/widget4';
import Widget5 from './Widgets5/widget5';


class App extends Component {
  render() {
    return (

      <div className="App">
        <header className="App-header">
        <div className="container">
        <h1>DASHBOARD</h1>
          <img src={logo} className="App-logo" alt="logo" />


          <div className="row">

          <Button color="danger" className="col-3">HELLO</Button><b></b><b></b>
          <Button color="danger"className="col-5">SALUT </Button> <b></b>
          <Button color="danger"className="col-2">BONJOUR</Button>
          </div>

        <div className="row">  
          <Widget className="col-2"/>
          <Widget1 className="col-4"></Widget1>
          <Widget className="col-6"/>
                </div>

          <Widget/>
          <Widget/>

          <div className="row">  
          <Widget1 className="col-3"></Widget1>
          <Widget2 className="col-3"></Widget2>
          <Widget1 className="col-3"></Widget1>
          <Widget1 className="col-3"></Widget1>
    </div>


          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
          </div>
        </header>

      </div>
    );
  }
}

export default App;
